42.920445',278,1,NULL,NULL,1,'flatcontent.blocks',584,'html','\"我有超过7年的国外设计项目管理经验。精通汉语、了解中华文化，独具审美能力，所以我可以为中国客户提供最佳服务。 擅长于印刷项目、工业分析、玩具设计、以及市场建立品牌方面。让您的设计梦想成真，是我的使命\"。&nbsp;<br>---<br>背景:<br><div><div>语言学/中文;&nbsp;学士学位，齐齐哈尔大学。<br><span style=\"background-color: initial;\">心理诊断学， 托木斯克立国家研究性大学。</span></div></div>',''),(279,NULL,'2021-01-12 11:51:59.888155','2021-01-12 11:51:59.888207',279,1,NULL,NULL,1,'flatcontent.blocks',583,'html','','<div>\"我在设计方面的经验主要致力于工业产品（机器人，工业产品，玩具...）和数字产品（网站，移动应用程序）的研究。<span style=\"background-color: initial;\">我喜欢所有类型的任务，无论是项目的完整设计还是在项目开发过程中的特定阶段提供及时的支持\"。</span></div><div><span style=\"background-color: initial;\">---<br></span><span style=\"background-color: initial;\">背景:<br><div>可持续设计与创新，硕士学位。<br><span style=\"background-color: initial;\">产品设计，学士学位。<br></span><span style=\"background-color: initial;\">法国南特大西洋设计学院。</span></div></span></div>'),(280,NULL,'2021-01-12 12:29:13.351501','2021-01-12 12:29:13.351535',280,1,NULL,NULL,1,'flatcontent.blocks',579,'html','<div>您好！ 我们是一家专门从事平面图形和工业设计的国际设计工作室。 我们在设计领域为有需要的客户提供专业的意见和专业的服务。 我们确保始终提供最美观、最有效的设计方案。</div>',''),(281,NULL,'2021-01-12 12:29:21.597849','2021-01-12 12:29:21.597884',281,1,NULL,NULL,1,'flatcontent.blocks',580,'html','爱我所爱，行我所行，我们喜欢直率和坦诚的沟通，这是设计方案中最有效的信息，也是双边利益的保证，直接关系着方案结果。 在设计方案的完成过程中，客户和设计人员是平等的，因此我们会向您直接表达我们的真实意见。 欢迎有共同信念客户，与我们团队一起迎接新的挑战！',''),(282,NULL,'2021-01-12 15:29:06.265149','2021-01-12 15:29:06.265207',282,1,NULL,NULL,1,'flatcontent.blocks',585,'html','\"好孩子\"公司的展示厅（昆山市）',''),(283,NULL,'2021-01-12 15:29:42.496685','2021-01-12 15:29:42.496720',283,1,NULL,NULL,1,'flatcontent.blocks',586,'html','展会上见到客户了',''),(284,NULL,'2021-01-12 15:30:24.804014','2021-01-12 15:30:24.804040',284,1,NULL,NULL,1,'flatcontent.blocks',587,'html','别慌张了，保持距离',''),(285,NULL,'2021-01-12 15:30:56.340701','2021-01-12 15:30:56.340761',285,1,NULL,NULL,1,'flatcontent.blocks',588,'html','我们在上海玩具展上的展台',''),(286,NULL,'2021-01-12 15:31:44.970250','2021-01-12 15:31:44.970278',286,1,NULL,NULL,1,'flatcontent.blocks',589,'html','Max和正邦设计公司的陈丹老总',''),(287,NULL,'2021-01-12 15:33:22.646524','2021-01-12 15:33:22.646561',287,1,NULL,NULL,1,'flatcontent.blocks',592,'html','展会在进行中',''),(288,NULL,'2021-01-12 15:33:50.394785','2021-01-12 15:33:50.394833',288,1,NULL,NULL,1,'flatcontent.blocks',593,'html','工厂的一名员工',''),(289,NULL,'2021-01-12 15:35:15.587738','2021-01-12 15:35:15.587784',289,1,NULL,NULL,1,'flatcontent.blocks',594,'html','“通往办公室的阶梯”',''),(290,NULL,'2021-01-12 15:35:31.390670','2021-01-12 15:35:31.390698',290,1,NULL,NULL,1,'flatcontent.blocks',595,'html','工作中。。。',''),(291,NULL,'2021-01-12 16:18:17.034427','2021-01-12 16:18:17.034486',291,1,NULL,NULL,1,'flatcontent.blocks',596,'html','接受CCTV关于玩具设计新趋势的采访',''),(292,NULL,'2021-01-14 11:53:36.188468','2021-01-14 11:53:36.188505',292,1,NULL,NULL,1,'flatcontent.blocks',597,'html','<div><div>我们办公室的3D打印机</div></div>',''),(293,NULL,'2021-01-14 11:53:56.590533','2021-01-14 11:53:56.590560',293,1,NULL,NULL,1,'flatcontent.blocks',598,'html','<div>我们的工业设计师Clemence在工作中</div>',''),(294,NULL,'2021-01-15 16:29:02.903193','2021-01-15 16:29:02.903238',294,1,NULL,NULL,1,'flatcontent.blocks',601,'title','最近完成的项目',''),(295,NULL,'2021-01-15 16:30:42.846502','2021-01-15 16:30:42.846574',295,1,NULL,NULL,1,'flatcontent.blocks',602,'title','最近完成的项目',''),(296,NULL,'2021-01-15 16:31:29.411756','2021-01-15 16:31:29.411797',296,1,NULL,NULL,1,'flatcontent.containers',76,'description','设计案例','');
